import React from 'react';
// import '../../App.css';
import Section from '../ResumeSections.js';
import '../ResumeSections.css';

function Resume() {
  return (
    <>
    <Section
      title="Erica Fu"
      style="name"
    >
        <div>
          <p>ericawfu@gmail.com</p>
          <p>+1 (650) 392-9822</p>
          <p>Pittsburgh, PA</p>
        </div>
    </Section>
    <Section
      title="Education"
      style="capitalized"
    >
    </Section>
    <Section
      title="May 2024"
      style="paragraph"
    >
      <div class="same-line"><h3>Carnegie Mellon University</h3><h4>B.S. in Information Systems</h4></div>
      <h3 class="same-line">Carnegie Mellon University</h3><h4 class="same-line">B.S. in Information Systems</h4>

    </Section>
  </>
  );
}

export default Resume;
